// src/components/trigger_automation.js

import React from 'react';
import axios from 'axios';

const TriggerAutomation = () => {
  const handleTrigger = () => {
    axios.post('http://localhost:5000/trigger-automation')
      .then((response) => {
        alert('Automation Triggered!');
        console.log('Automation triggered:', response.data);
      })
      .catch((error) => {
        console.error('Error triggering automation:', error);
      });
  };

  return (
    <div>
      <h3>Trigger Automation</h3>
      <button onClick={handleTrigger}>Trigger</button>
    </div>
  );
};

export default TriggerAutomation;
